import React from "React"
import './index.scss';

class HomePage extends React.Component {
    render(){
        return(
            <div>
                <h1>Welcome to My Website</h1>
                <p>This is the homepage of my website built with React.</p>
                <p>Feel free to explore!</p>
            </div>
        );
    }
}
export default HomePage;
